import React from 'react';
import { Link, useHistory } from 'react-router-dom';
import axios from 'axios'; // Import axios for making HTTP requests
import './Header.css'; 

const Header = () => {
  const history = useHistory();

  const handleLogout = async () => {
    try {
      // Send a request to the server to delete the user from the database
      const response = await axios.post('/logout', {
        // Optional: Include any additional data in the request body
      });
  
      // Handle the response from the server if needed
      console.log(response.data); // Example: Log the response data
  
      // Clear user session information and update login state
      // For example, you can remove the user token from local storage or clear cookies.
  
      // Redirect to the login page after successful logout
      history.push('/login');
    } catch (error) {
      console.log(error);
      // Handle error if the server request fails
    }
  };
  

  return (
    <div>
      <div className='heading'>
        <h1 className='h1'>Student Portal</h1>
        <p className='para'>University info</p>
        <button className='lb' onClick={handleLogout}>Logout</button>
      </div>
      <div className="header-container">
        <Link to="/course-details" className="header-link">Course Details</Link>
        <Link to="/hostel" className="header-link">Hostel</Link>
        <Link to="/events" className="header-link">Events</Link>
        <Link to="/others" className="header-link">Others</Link>
      </div>
    </div>
  );
};

export default Header;
